affinity: |
  nodeAffinity:
    requiredDuringSchedulingIgnoredDuringExecution:
      nodeSelectorTerms:
        - matchExpressions:
            - key: node.kubernetes.io/nodegroup
              operator: In
              values:
                - app

args:
  - start-dev
  - --import-realm

command:
  - /opt/keycloak/bin/kc.sh

database:
  vendor: mysql
  hostname: keycloak.mysql.dev
  port: 3306
  database: keycloak
  username: keycloak
  password: keycloak

extraEnv: |
  - name: KC_BOOTSTRAP_ADMIN_USERNAME
    value: admin
  - name: KC_BOOTSTRAP_ADMIN_PASSWORD
    value: admin
  - name: KC_PROXY
    values: edge
  - name: JAVA_OPTS_APPEND
    value: -Djgroups.dns.query=keycloak-headless.keycloak.svc.cluster.local

extraVolumes: |
  - name: keycloak-realms
    secret:
      secretName: keycloak-realms

extraVolumeMounts: |
  - name: keycloak-realms
    mountPath: /opt/keycloak/data/import

fullnameOverride: keycloak

http:
  relativePath: /

image:
  tag: 26.1.2

resources:
  requests:
    cpu: 200m
    memory: 1024Mi
  limits:
    memory: 1024Mi

service:
  httpPort: 8080
  httpsPort: 8443

secrets:
  realms:
    data:
      realm-dev.json: 
